import axios from "axios";
import { GET_PEO_VISION, DELETE_PEO_VISION, ADD_PEO_VISION } from "./types";
import { tokenConfig } from "./auth";
export const getPeo_Visions = () => (dispatch, getState) => {
  //asy request with axios we are making here
  axios
    .get("http://127.0.0.1:8000/api/peo_vision/", tokenConfig(getState))
    .then(res => {
      dispatch({
        type: GET_PEO_VISION, //in action we are passing type action.type
        payload: res.data
      });
    })
    .catch(err => console.log(err));
};
//delete plo
export const deletePeo_Visions = id => (dispatch, getState) => {
  axios
    .delete("http://localhost:8000/api/peo_vision/" + id, tokenConfig(getState))
    .then(res => {
      dispatch({
        type: DELETE_PEO_VISION,
        EOADD_PEO_VISIONpayload: id
      });
    })
    .catch(err => console.log(err));
};
//ADD plo
export const addPeo_Vision = peo_vision => (dispatch, getState) => {
  axios
    .post("http://127.0.0.1:8000/api/peo_vision/", peo_vision)
    .then(res => {
      dispatch({
        type: ADD_PEO_VISION,
        payload: res.data
      });
    })
    .catch(err => console.log(err));
};
